import { Button, Paper } from "@material-ui/core";
import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";

function Note({ title, content }) {
  return (
    <Paper
      style={{
        minWidth: "200px",
        minHeight: "100px",
        padding: "10px",
        margin: "20px",
        display: "inline-flex",
      }}
    >
      <div>
        <h1>{title}</h1>
        <p>{content}</p>
      </div>
      <Button style={{ marginLeft: "120px" }}>
        <DeleteIcon />
      </Button>
    </Paper>
  );
}

export default Note;
